import React from "react";
import styles from "./NavBar.module.css";
const NavBar = () => {
  return (
    <header>
      <nav className={styles.navbar}>
        <div>
          <h1 className={styles.logo}>Wiki</h1>
          <h1 className={styles.logoWho}>WHO</h1>
        </div>
        <ul>
          <li>MERCH </li>
          <li>HUBS</li>
          <li>EPISODES </li>
          <li>CONTACT</li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
